async () => {
  // Fill the name field
  await context.page.fill('#name', 'John Doe');

  // Fill the email field
  await context.page.fill('#email', 'john@example.com');

  // Fill the message field
  await context.page.fill('#message', 'Hello, this is a test message');

  // Click the submit button
  await context.page.click('button[type="submit"]');

  // Wait for the result to appear
  await context.page.waitForSelector('#result');

  // Get the text content from #result
  const resultText = await context.page.textContent('#result');

  // Store in vars for set_result
  vars.resultText = resultText;

  return { success: true };
}

async () => {
  return {
    resultText: vars.resultText,
    formFilled: true
  };
}

